;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;)</pre><p><br/></p>', '3', '2019-07-04 09:24:53.557335', '2019-07-04 09:26:06.945533', '3', '2', '2');
INSERT INTO `blog_article` VALUES ('3', 'php学习记录', '一些经常使用的函数，在工作过程中遇到的一些很简单的问题，解决的办法都记录下来', 'article_img/2019/07/04/u40388699923775669571fm58bpow353bpoh373.jpg', '<p><span style=\"font-size: 32px; font-weight: bold;\">php学习记录</span></p><p>header(&quot;Content-type:text/html;charset=utf-8&quot;);</p><p><span style=\"font-size: 16px;\">1、判断一个字符串是否在另一个字符串中：strlen()计算字符串的长度</span></p><p>1）、<span style=\"color: rgb(255, 0, 0);\">strpos</span>(&#39;字符串&#39;，&#39;要判断的字符串&#39;)，这在php中效率跟性能是比较高的，建议使</p><p>用；返回的是字符第一次出现在另一个字符串中的位置。<span style=\"font-family: monospace;\">用&nbsp;“===”进行判断</span></p><p>2）、<span style=\"color: rgb(255, 0, 0);\">strstr</span>(&#39;字符串&#39;，&#39;要判断的字符串&#39;)，判断字符串第一次出现，并返回字符串的剩余部</p><p>分；</p><p>3）、利用数组：<span style=\"color: rgb(255, 0, 0);\">in_array</span>(value,$arr）,返回true or false;</p><p><span style=\"font-size: 16px;\">2、字符串的截取(</span><span style=\"font-size: 16px; color: rgb(0, 176, 80);\">在模板中使用：{$value|substr(0,10,&#39;utf-8&#39;)}</span><span style=\"font-size: 16px;\">)</span></p><p>1）、<span style=\"color: rgb(255, 0, 0);\">substr</span>($str,$start,$end,$length); 栗子:（截取中文按3的倍数来截取）</p><p>//按各种方式进行截取</p><p>$str = &quot;ABCDEFGHIJKLMNOPQRSTUVWXYZ&quot;;</p><p>&nbsp; $str1 = substr($str,5);</p><p>&nbsp; echo &quot;从第5个字符开始取至最后：&quot;.$str1.&quot;&quot;;</p><p>&nbsp; $str2 = substr($str,9,4);</p><p>&nbsp; echo &quot;从第9个字符开始取4个字符：&quot;.$str2.&quot;&quot;;</p><p>&nbsp; $str3 = substr($str,-5);</p><p>&nbsp; echo &quot;取倒数5个字符：&quot;.$str3.&quot;&quot;;</p><p>&nbsp; $str4 = substr($str,-8,4);</p><p>&nbsp; echo &quot;从倒数第8个字符开始向后取4个字符：&quot;.$str4.&quot;&quot;;</p><p>&nbsp; $str5 = substr($str,-8,-2);</p><p>&nbsp; echo &quot;从倒数第8个字符开始取到倒数第2个字符为止：&quot;.$str5.&quot;</p><p><span style=\"font-size: 16px;\">2）、中文截取：</span><span style=\"color: rgb(255, 0, 0);\">mb_substr</span>( $str, $start, $length, $encoding );</p><p>$str，需要截断的字符串</p><p>$start，截断开始处，起始处为0</p><p>$length，要截取的字数</p><p>$encoding，网页编码，如utf-8,GB2312,GBK</p><p><span style=\"font-size: 16px;\">3）、获取中文长度：</span><span style=\"color: rgb(255, 0, 0);\">mb_strlen</span>( $str, $encoding )$str，要计算长度的字符串</p><p>$encoding，网页编码，如utf-8,GB2312,GBK</p><p>4）、mb_strcut()对中文更有效果</p><p>5）、<span style=\"color: rgb(255, 0, 0);\">str_replace</span>(&#39;被替换内容&#39;，&#39;新内容&#39;，’字符串‘);</p><p><span style=\"font-size: 16px;\">3、数据库数据的处理：</span></p><p>遇到需要在一张表格插入另一张表格的数据时，有相同的就追加数据，不同的就添加数据，利用</p><p>php代码，把一张表的数据全部取出，然后去更新另一张数据表的数据。</p><p><span style=\"font-size: 16px;\">4、array_map()，与array_fitler()的用法：</span></p><p><span style=\"color: rgb(0, 119, 0);\">array_map():</span><span style=\"color: rgb(118, 146, 60);\">将函数作用到数组中的每个值上，每个值都乘以本身，并返回带有新值的数组：</span></p><p>&lt;?php\r\n			function myfunction($v)\r\n			{\r\n 				 return($v*$v);\r\n			}\r\n\r\n			$a=array(1,2,3,4,5);\r\n			print_r(<span style=\"font-family: monospace;\">array_map(&quot;myfunction&quot;,$a)</span>);\r\n		?&gt;</p><p><span style=\"color: rgb(0, 119, 0);\">array_filter()的含义，它是将数组的值依次传入其中进行运算的，也就相当于foreach一遍</span></p><p>function old($var)</p><p>{</p><p>　　		 &nbsp; &nbsp;return(<span style=\"color: rgb(0, 0, 187);\">$var&nbsp;</span><span style=\"color: rgb(0, 119, 0);\">%&nbsp;</span><span style=\"color: rgb(0, 0, 187);\">2&nbsp;</span><span style=\"color: rgb(0, 119, 0);\">==&nbsp;</span><span style=\"color: rgb(0, 0, 187);\">1</span><span style=\"color: rgb(0, 119, 0);\">);</span></p><p><span style=\"color: rgb(0, 119, 0);\">}</span></p><p>　	 &nbsp; &nbsp; <span style=\"color: rgb(0, 0, 187);\">$array1&nbsp;</span><span style=\"color: rgb(0, 119, 0);\">=&nbsp;array(</span><span style=\"color: rgb(221, 0, 0);\">&quot;a&quot;</span><span style=\"color: rgb(0, 119, 0);\">=&gt;</span><span style=\"color: rgb(0, 0, 187);\">1</span><span style=\"color: rgb(0, 119, 0);\">,&nbsp;</span><span style=\"color: rgb(221, 0, 0);\">&quot;b&quot;</span><span style=\"color: rgb(0, 119, 0);\">=&gt;</span><span style=\"color: rgb(0, 0, 187);\">2</span><span style=\"color: rgb(0, 119, 0);\">,&nbsp;</span><span style=\"color: rgb(221, 0, 0);\">&quot;c&quot;</span><span style=\"color: rgb(0, 119, 0);\">=&gt;</span><span style=\"color: rgb(0, 0, 187);\">3</span><span style=\"color: rgb(0, 119, 0);\">,&nbsp;</span><span style=\"color: rgb(221, 0, 0);\">&quot;d&quot;</span><span style=\"color: rgb(0, 119, 0);\">=&gt;</span><span style=\"color: rgb(0, 0, 187);\">4</span><span style=\"color: rgb(0, 119, 0);\">,&nbsp;</span><span style=\"color: rgb(221, 0, 0);\">&quot;e&quot;</span><span style=\"color: rgb(0, 119, 0);\">=&gt;</span><span style=\"color: rgb(0, 0, 187);\">5</span><span style=\"color: rgb(0, 119, 0);\">);</span></p><p>　	 &nbsp; &nbsp; <span style=\"color: rgb(0, 0, 187);\">print_r</span><span style=\"color: rgb(0, 119, 0);\">(</span><span style=\"color: rgb(0, 0, 187);\">array_filter</span><span style=\"color: rgb(0, 119, 0);\">(</span><span style=\"color: rgb(0, 0, 187);\">$array1</span><span style=\"color: rgb(0, 119, 0);\">,&nbsp;</span><span style=\"color: rgb(221, 0, 0);\">&quot;old&quot;</span><span style=\"color: rgb(0, 119, 0);\">));</span></p><p><span style=\"font-size: 16px;\">5、file_get_contents()，与curl_init()的区别：</span></p><p>file_get_contents()不能抓取以https开始的网址地址，而curl_init()就可以，而且curl_init()还可以设置地址的是否检查证书等</p><p><span style=\"font-size: 16px;\">6、tp在模板使用函数：{：函数名称()}，需要加“：”。</span></p><p><span style=\"font-size: 16px;\">7、利用wamp的apache的ab进行压力测试：(进入目录要加cd)</span></p><p><span style=\"font-size: 16px;\">F:\\cd wamp\\bin\\apache\\apache2.4.9\\bin\\ .\\ab -n500 -c500 &nbsp;url</span></p><p><span style=\"font-size: 16px;\">8、</span>session_destroy是注销所有的session变量,并且结束session会话;</p><p>session_unset()并不注销session变量,但把所有的session变量的值清空.</p><p>9、<span style=\"color: rgb(255, 0, 0);\">判断某字符串是否为中文</span>：</p><p><span style=\"font-family: monospace;\">if</span>&nbsp;<span style=\"font-family: monospace;\">(preg_match(&quot;/[\\x7f-\\xff]/&quot;,&nbsp;$str))&nbsp;{&nbsp;&nbsp;//判断字符串中是否有中文</span></p><p><span style=\"font-family: monospace;\">echo</span>&nbsp;<span style=\"font-family: monospace;\">&quot;是中文&quot;;</span></p><p><span style=\"font-family: monospace;\">}else{</span></p><p><span style=\"font-family: monospace;\">echo</span>&nbsp;<span style=\"font-family: monospace;\">&quot;不是中文&quot;;</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">10、</span></p><p>PHP比较运算符出现的频率实在是太高了，尤其是 ==</p><p>if(a == b){</p><p>// do something</p><p>}</p><p>但是，你真的掌握了 == 了吗？细节很重要！</p><p>来看下面的代码，说出你认为正确的答案</p><p>var_dump(&#39;&nbsp; 123fg456&#39;==123);</p><p>var_dump(&#39;some string&#39; == 0);</p><p>var_dump(123.0 == &#39;123d456&#39;);</p><p>var_dump(0 == &quot;a&quot;);</p><p>var_dump(&quot;1&quot; == &quot;01&quot;);</p><p>var_dump(&quot;1&quot; == &quot;1e0&quot;);</p><p>先想出你的答案，然后再运行一次看看。如果答案没有差错，那么恭喜你，基础知识很扎实。</p><p><span style=\"font-weight: bold;\">解释：</span></p><p><span style=\"color: rgb(255, 0, 0);\">如果比较一个整数和字符串，则字符串会被转换为整数</span>。如果比较两个数字字符串，则作为整数比较。此规则也适用于 switch 语句。</p><p>特别注意，<span style=\"color: rgb(255, 0, 0);\">字符串转换为整数时，是从左到右，直到遇到非数字字符为止</span>。也就是说 &#39;123abc456&#39; 会被转换成 123，而不是 123456。另外字符串开始的空格会被忽略，比如 &#39;&nbsp;&nbsp; 234abc&#39; 转换为 234。</p><p>11、<span style=\"color: rgb(255, 0, 0);\">ignore_user_abort(); //即使Client断开(如关掉浏览器)，PHP脚本也可以继续执行.</span></p><p>set_time_limit(0); // 执行时间为无限制，php默认执行时间是30秒，可以让程序无限制的执行下	</p><p>去</p><p><span style=\"font-size: 16px;\">12、</span><span style=\"font-size: 16px; color: rgb(255, 0, 0);\">除掉字符串中的换行符：str_replace(&quot;\\r\\n\\t&quot;,&#39;&#39;,$str);</span></p><p><span style=\"font-size: 16px;\">13、</span><span style=\"font-size: 16px; color: rgb(192, 80, 77);\">php执行时间</span><span style=\"font-size: 16px;\">：</span>set_time_limit(0)</p><p>14、strip_tags 去掉 HTML 及 PHP 的标记。 语法: string strip_tags(string str); 传回值: 字串 函式种</p><p>类:</p><p>15、memcache 缓存：</p><p><img alt=\"\" data-media-type=\"image\" src=\"D:/xm/%E6%96%87%E4%BB%B6/youdao/jieson414@163.com/90100284e5b04d2a87260059c7930a91/clipboard.png\" style=\"width: 588.983px;\" data-attr-org-src-id=\"6C4FFF9EC23049BB900787613B18FBCE\"/></p><p><span style=\"font-size: 16px;\">16、php.ini中safe_mode开启之后对于PHP系统函数的影响</span></p><p>Ckdir(),move_uploaded_file(),chgrp,parse_ini_file(),chown(),rmdir(),copy(),rename(),fopen(),	 require(),highlight_file(),show()，exec(),shell_exec(),pasathru(),system(),popen()</p><p><span style=\"font-size: 16px;\">17、算法：</span></p><p>$g=14;</p><p>$h=$g+=10;//$h=($g=($g+10));</p><p>18、php运算符优先级：</p><p>优先级从大到小，clone new <span style=\"color: rgb(255, 0, 0);\">&gt;</span> [ <span style=\"color: rgb(255, 0, 0);\">&gt;</span> ++ --~ @ (int) (float)(array)(object)(bool)<span style=\"color: rgb(255, 0, 0);\">&gt;</span>! <span style=\"color: rgb(255, 0, 0);\">&gt;</span>*/% <span style=\"color: rgb(255, 0, 0);\">&gt;</span>+ - <span style=\"color: rgb(255, 0, 0);\">&gt;</span>&lt;&lt;&gt;&gt;<span style=\"color: rgb(255, 0, 0);\"> &gt;</span>==!= ===!==&lt;&gt; <span style=\"color: rgb(255, 0, 0);\">&gt;</span>&amp; <span style=\"color: rgb(255, 0, 0);\">&gt;</span> ^ <span style=\"color: rgb(255, 0, 0);\">&gt;</span> | &amp;&amp;<span style=\"color: rgb(255, 0, 0);\"> &gt;</span>? == and xor or ,</p><p>19、PDO连接数据：（php5）</p><p>&lt;?php</p><p><span style=\"color: rgb(247, 117, 103);\">$pdo = new PDO(&quot;mysql:host=localhost;dbname=db_demo&quot;,&quot;root&quot;,&quot;&quot;);</span></p><p>if($pdo -&gt; <span style=\"color: rgb(247, 117, 103);\">exec</span>(&quot;insert into db_demo(name,content) values(&#39;title&#39;,&#39;content&#39;)&quot;)){</p><p>echo &quot;插入成功！&quot;;</p><p>echo $pdo -&gt; <span style=\"color: rgb(247, 117, 103);\">lastinsertid</span>();</p><p>}</p><p>?&gt;</p><p>&lt;?php</p><p><span style=\"color: rgb(247, 117, 103);\">$pdo = new PDO(&quot;mysql:host=localhost;dbname=db_demo&quot;,&quot;root&quot;,&quot;&quot;);</span></p><p>$rs = $pdo -&gt; query(&quot;select * from test&quot;);</p><p>while($row = $rs -&gt; <span style=\"color: rgb(247, 117, 103);\">fetch</span>()){</p><p>print_r($row);</p><p>}</p><p>?&gt;</p><p>开启事务：</p><p>$PDO-&gt;beginTransaction()；</p><p>$PDO-&gt;commit();</p><p>$PDO-&gt;rollback();</p><p>20、strtoupper() 函数把字符串转换为大写。</p><p>strtolower()函数把字符串转换成小写。</p><p>21、apache 配置多站点：</p><p>1、在apache配置文件(conf)<span style=\"color: rgb(255, 0, 0);\">httpd.conf </span>里面找到 #&nbsp;Virtual&nbsp;hosts<span style=\"color: rgb(255, 0, 0);\"> </span></p><p><span style=\"color: rgb(255, 0, 0);\">Include&nbsp;conf/extra/httpd-vhosts.conf&nbsp;</span>把这行的#去除,去除#说明开始载入扩展&nbsp;(extra是扩展</p><p>文件夹）</p><p><span style=\"font-family: Verdana; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">&lt;Directory&nbsp;&gt;</span></p><p><span style=\"font-family: Verdana; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">Options FollowSymLinks</span></p><p><span style=\"font-family: Verdana; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">AllowOverride All</span></p><p><span style=\"font-family: Verdana; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">Order deny,allow</span></p><p><span style=\"font-family: Verdana; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255); font-weight: bold;\">Allow </span><span style=\"font-family: Verdana; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">from all</span></p><p><span style=\"font-family: Verdana; color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">&lt;/Directory&gt;</span></p><p>2、在httpd:-vhosts.conf 中加如下配置：</p><p>&lt;VirtualHost *:80&gt;</p><p>DocumentRoot &quot;F:/wamp/www/tpshop&quot;</p><p>ServerName www.tpshop123.com</p><p>ErrorLog &quot;logs/dummy-host2.example.com-error.log&quot;</p><p>CustomLog &quot;logs/dummy-host2.example.com-access.log&quot; common</p><p>&lt;/VirtualHost&gt;</p><p>3、在系统目录下hosts配置</p><p>192.168.1.8 &nbsp;<a href=\"http://www.sdms.tpshop.com\"><span style=\"color: rgb(0, 56, 132);\">www.sdms.tpshop.com</span></a></p><p>4、重启服务</p><p>22、constant() 函数返回一个常量的值。</p><p>23、php遍历xml：</p><p>$dom= new DOMDocument();</p><p>		$dom-&gt;loadXML(base64_decode($output));</p><p>		$arr=$dom-&gt;getElementsByTagName(&#39;billno&#39;);</p><p>		$sqlArr=array();</p><p>		foreach ($arr as $k=&gt;$v) {</p><p>			$sqlArr[]=&quot;insert into sdms_ems_orderNo (orderNo,type) values (&#39;&quot;.$v-	</p><p>	&gt;nodeValue.&quot;&#39;,{$businessType})&quot;;</p><p>			//echo $v-&gt;nodeValue.&#39;,&#39;;</p><p>		}</p><p>24、php 使用soap访问webservice</p><p>$soap=new SoapClient($url);</p><p>$soap-&gt;调用的方法（array（参数））；</p><p>25、<span style=\"color: rgb(223, 64, 42);\">gb2312与utf-8互转化</span>：</p><p>$content = iconv(&quot;gb2312&quot;,&quot;utf-8//IGNORE&quot;,$content)；</p><p><span style=\"color: rgb(223, 64, 42);\">php 判断字符串的字符编码：</span></p><p>$encode = mb_detect_encoding($keytitle, array(&quot;ASCII&quot;,&#39;UTF-</p><p>8′,&quot;GB2312′,&quot;GBK&quot;,&#39;BIG5′));</p><p><span style=\"color: rgb(223, 64, 42);\">php把数据存为图片：</span></p><p><span style=\"font-size: 13px; font-family: Verdana; background-color: rgb(254, 254, 242);\">$a = file_put_contents(&#39;./test.png&#39;, base64_decode(base64编码的数据));//返回的是字节</span></p><p><span style=\"font-size: 13px; font-family: Verdana; color: rgb(223, 64, 42);\">php把图片转为数据：</span></p><p><span style=\"font-size: 13px; font-family: Verdana; background-color: rgb(254, 254, 242);\">$str = file_get_contents(&#39;./test.png&#39;);</span></p><p><span style=\"font-size: 13px; font-family: Verdana; background-color: rgb(254, 254, 242);\">echo base64_encode($str);</span></p><p><span style=\"font-size: 13px; font-family: Verdana;\">26、</span>PHP自带的判断是否是中文，</p><p>preg_match(&#39;/[^\\x00-\\x7F]/&#39;, $str ) //中文</p><p>preg_match(&#39;/[0-9]/&#39;, $str) //数字</p><p>preg_match(&#39;/[a-zA-Z]/&#39;, $str)//英文</p><p>27、webservice应用程序服务，使用soap来访问对象连接</p><p>28、</p><p><img alt=\"\" data-media-type=\"image\" src=\"D:/xm/%E6%96%87%E4%BB%B6/youdao/jieson414@163.com/cf2e5467dd3547cfa3983e8d7311b01f/clipboard.png\" style=\"width: 620px;\" data-attr-org-src-id=\"D90F37360B5B4340BBABE7F9834E75A6\"/></p><p><span style=\"font-size: 13px; font-family: Verdana;\">29、</span><span style=\"font-size: 13px; font-family: Verdana; font-weight: bold;\">php 短信验证：</span></p><p>1、用户输入手机号，请求获取短信验证码。</p><p>2、thinkphp生成短信验证码，存储，同时和其他参数一起发送请求给云片。</p><p>3、云片发送短信验证码到指定手机号。</p><p>4、用户输入短信验证码。</p><p>5、thinkphp根据验证码是否正确、验证码是否过期两个条件判断是否验证通过。</p><p><span style=\"font-family: monospace;\">// 生成短信验证码 4位</span></p><p><span style=\"font-family: monospace;\">public</span> <span style=\"font-family: monospace;\">function</span> <span style=\"font-family: monospace;\">createSMSCode($length</span> <span style=\"font-family: monospace;\">= 4){</span></p><p><span style=\"font-family: monospace;\">$min</span> <span style=\"font-family: monospace;\">= pow(10 , ($length</span> <span style=\"font-family: monospace;\">- 1));</span></p><p><span style=\"font-family: monospace;\">$max</span> <span style=\"font-family: monospace;\">= pow(10, $length) - 1;</span></p><p><span style=\"font-family: monospace;\">return</span> <span style=\"font-family: monospace;\">rand($min, $max);</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">// 验证短信验证码是否有效</span></p><p><span style=\"font-family: monospace;\">public</span> <span style=\"font-family: monospace;\">function</span> <span style=\"font-family: monospace;\">checkSMSCode(){</span></p><p><span style=\"font-family: monospace;\">$mobile</span> <span style=\"font-family: monospace;\">= $_POST[&#39;mobile&#39;];</span></p><p><span style=\"font-family: monospace;\">$code</span> <span style=\"font-family: monospace;\">= $_POST[&#39;code&#39;];</span></p><p><span style=\"font-family: monospace;\">$nowTimeStr</span> <span style=\"font-family: monospace;\">= date(&#39;Y-m-d H:i:s&#39;);</span></p><p><span style=\"font-family: monospace;\">$smscode</span> <span style=\"font-family: monospace;\">= D(&#39;smscode&#39;);</span></p><p><span style=\"font-family: monospace;\">$smscodeObj</span> <span style=\"font-family: monospace;\">= $smscode-&gt;where(&quot;mobile=&#39;$mobile&#39;&quot;)-&gt;find();</span></p><p><span style=\"font-family: monospace;\">if($smscodeObj){</span></p><p><span style=\"font-family: monospace;\">$smsCodeTimeStr</span> <span style=\"font-family: monospace;\">= $smscodeObj[&#39;update_at&#39;];</span></p><p><span style=\"font-family: monospace;\">$recordCode</span> <span style=\"font-family: monospace;\">= $smscodeObj[&#39;code&#39;];</span></p><p><span style=\"font-family: monospace;\">$flag</span> <span style=\"font-family: monospace;\">= $this-&gt;checkTime($nowTimeStr, $smsCodeTimeStr);</span></p><p><span style=\"font-family: monospace;\">if(!$flag){</span></p><p><span style=\"font-family: monospace;\">$result</span> <span style=\"font-family: monospace;\">= array(</span></p><p><span style=\"font-family: monospace;\">&#39;code&#39;</span> <span style=\"font-family: monospace;\">=&gt; &#39;1&#39;,</span></p><p><span style=\"font-family: monospace;\">&#39;ext&#39;</span> <span style=\"font-family: monospace;\">=&gt; &#39;验证码过期，请刷新后重新获取&#39;</span></p><p><span style=\"font-family: monospace;\">);</span></p><p><span style=\"font-family: monospace;\">echo</span> <span style=\"font-family: monospace;\">json_encode($result,JSON_UNESCAPED_UNICODE);</span></p><p><span style=\"font-family: monospace;\">return;</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">if($code</span> <span style=\"font-family: monospace;\">!= $recordCode){</span></p><p><span style=\"font-family: monospace;\">$result</span> <span style=\"font-family: monospace;\">= array(</span></p><p><span style=\"font-family: monospace;\">&#39;code&#39;</span> <span style=\"font-family: monospace;\">=&gt; &#39;2&#39;,</span></p><p><span style=\"font-family: monospace;\">&#39;ext&#39;</span> <span style=\"font-family: monospace;\">=&gt; &#39;验证码错误，请重新输入&#39;</span></p><p><span style=\"font-family: monospace;\">);</span></p><p><span style=\"font-family: monospace;\">echo</span> <span style=\"font-family: monospace;\">json_encode($result,JSON_UNESCAPED_UNICODE);</span></p><p><span style=\"font-family: monospace;\">return;</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">$result</span> <span style=\"font-family: monospace;\">= array(</span></p><p><span style=\"font-family: monospace;\">&#39;code&#39;</span> <span style=\"font-family: monospace;\">=&gt; &#39;0&#39;,</span></p><p><span style=\"font-family: monospace;\">&#39;ext&#39;</span> <span style=\"font-family: monospace;\">=&gt; &#39;验证通过&#39;</span></p><p><span style=\"font-family: monospace;\">);</span></p><p><span style=\"font-family: monospace;\">echo</span> <span style=\"font-family: monospace;\">json_encode($result,JSON_UNESCAPED_UNICODE);</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">// 验证验证码时间是否过期</span></p><p><span style=\"font-family: monospace;\">public</span> <span style=\"font-family: monospace;\">function</span> <span style=\"font-family: monospace;\">checkTime($nowTimeStr,$smsCodeTimeStr){</span></p><p><span style=\"font-family: monospace;\">//$nowTimeStr = &#39;2016-10-15 14:39:59&#39;;</span></p><p><span style=\"font-family: monospace;\">//$smsCodeTimeStr = &#39;2016-10-15 14:30:00&#39;;</span></p><p><span style=\"font-family: monospace;\">$nowTime</span> <span style=\"font-family: monospace;\">= strtotime($nowTimeStr);</span></p><p><span style=\"font-family: monospace;\">$smsCodeTime</span> <span style=\"font-family: monospace;\">= strtotime($smsCodeTimeStr);</span></p><p><span style=\"font-family: monospace;\">$period</span> <span style=\"font-family: monospace;\">= floor(($nowTime-$smsCodeTime)/60); //60s</span></p><p><span style=\"font-family: monospace;\">if($period&gt;=0 &amp;&amp; $period&lt;=20){</span></p><p><span style=\"font-family: monospace;\">return</span> <span style=\"font-family: monospace;\">true;</span></p><p><span style=\"font-family: monospace;\">}else{</span></p><p><span style=\"font-family: monospace;\">return</span> <span style=\"font-family: monospace;\">false;</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">30、php跳转的几种方法：</span></p><p><span style=\"font-family: monospace;\">1、tp框架：U() 方法，redirect() 方法</span></p><p><span style=\"font-family: monospace;\">2、header(&quot;Location:url&quot;);</span></p><p><span style=\"font-family: monospace;\">3、echo &quot;&lt;script&gt;window.location.href=url&lt;/script&gt;&quot;</span></p><p><span style=\"font-family: monospace;\">4、</span><span style=\"font-family: Tahoma;\">&lt;&nbsp;&nbsp; meta&nbsp;&nbsp; http-equiv = &quot;refresh&quot;&nbsp;&nbsp;content = &quot;1;url=http:// bbs.lampbrother.net&quot; &gt;</span></p><p><span style=\"font-family: Tahoma;\">31</span><span style=\"font-family: Tahoma; color: rgb(223, 64, 42);\">、</span><a href=\"https://www.oschina.net/code/snippet_144656_45460\"><span style=\"font-size: 16px; color: rgb(223, 64, 42);\">PHP代码获取客户端IP地址经纬度及所在城市</span></a></p><p><span style=\"font-family: monospace;\">&lt;?php</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;$getIp=$_SERVER[&quot;REMOTE_ADDR&quot;];</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;echo</span> <span style=\"font-family: monospace;\">&#39;IP:&#39;,$getIp;</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;echo</span> <span style=\"font-family: monospace;\">&#39;&lt;br/&gt;&#39;;</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;$content</span> <span style=\"font-family: monospace;\">= file_get_contents(&quot;http://api.map.baidu.com/location/ip?	</span></p><p><span style=\"font-family: monospace;\"> &nbsp; &nbsp;ak=7IZ6fgGEGohCrRKUE9Rj4TSQ&amp;ip={$getIp}&amp;coor=bd09ll&quot;);</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;$json</span> <span style=\"font-family: monospace;\">= json_decode($content);</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;echo</span> <span style=\"font-family: monospace;\">&#39;log:&#39;,$json-&gt;{&#39;content&#39;}-&gt;{&#39;point&#39;}-&gt;{&#39;x&#39;};//按层级关系提取经度数据</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;echo</span> <span style=\"font-family: monospace;\">&#39;&lt;br/&gt;&#39;;</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;echo</span> <span style=\"font-family: monospace;\">&#39;lat:&#39;,$json-&gt;{&#39;content&#39;}-&gt;{&#39;point&#39;}-&gt;{&#39;y&#39;};//按层级关系提取纬度数据</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;echo</span> <span style=\"font-family: monospace;\">&#39;&lt;br/&gt;&#39;;</span></p><p><span style=\"font-family: monospace;\">&nbsp;&nbsp;print</span> <span style=\"font-family: monospace;\">$json-&gt;{&#39;content&#39;}-&gt;{&#39;address&#39;};//按层级关系提取address数据</span></p><p><span style=\"font-family: monospace;\">?&gt;</span></p><p><span style=\"font-family: monospace;\">32、php抛出异常：</span></p><p><span style=\"font-family: monospace;\">try{</span></p><p><span style=\"font-family: monospace;\">if(){</span></p><p><span style=\"font-family: monospace;\">throw new Exception()</span></p><p><span style=\"font-family: monospace;\">}catch(Exception $e){</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">}</span></p><p><span style=\"font-family: monospace;\">33、php原生连接数据库：</span></p><p>$conn=mysql_connect(&quot;localhost&quot;,&quot;big&quot;,&quot;123456&quot;);&nbsp;&nbsp;&nbsp;&nbsp;</p><p>if(!$conn){&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;echo&nbsp;&quot;connect&nbsp;failed&quot;;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;exit;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>}&nbsp;&nbsp;&nbsp;</p><p>mysql_select_db(&quot;big&quot;,$conn);&nbsp;&nbsp;&nbsp;</p><p>mysql_query(&quot;set&nbsp;names&nbsp;utf8&quot;);&nbsp;&nbsp;</p><p>34、截取字符串中的数字：</p><p><span style=\"font-family: monospace;\">&nbsp;</span><span style=\"font-family: monospace; color: rgb(223, 64, 42);\">preg_replace(&#39;/\\D/s&#39;,&nbsp;&#39;&#39;,&nbsp;$str);</span></p><p><span style=\"font-family: monospace;\">35、使用</span><span style=\"font-family: monospace; color: rgb(223, 64, 42);\">array_map</span><span style=\"font-family: monospace;\">():</span></p><p>&lt;?php\r\n			function myfunction($v){\r\n			 	 return($v*$v);//$v就是数组$a的值，这里实现数组的值怎么取，自定义，性能速</p><p>度上会比较快\r\n			}\r\n			$a=array(1,2,3,4,5);\r\n			print_r(<span style=\"font-family: monospace;\">array_map(&quot;myfunction&quot;,$a)</span>);\r\n		?&gt;</p><p>36、php读取目录下的所有文件：</p><p>$dir=&quot;./caxa/&quot;;</p><p>$file=<span style=\"color: rgb(223, 64, 42);\">scandir</span>($dir);</p><p>print_r($file);</p><p>37、<span style=\"color: rgb(223, 64, 42);\">addslashes</span>（）,php转义特殊字符，比如单引号，加个反斜杠\\，<span style=\"font-family: monospace; color: rgb(223, 64, 42);\">stripslashes</span><span style=\"font-family: monospace;\">（）去掉反</span></p><p><span style=\"font-family: monospace;\">斜杠\\</span></p><p>home-&gt;goods-&gt;goodsInfo 就有这个例子：</p><p>$this-&gt;assign(&#39;goods_name&#39;,<span style=\"color: rgb(223, 64, 42);\">addslashes</span>($goods[&#39;goods_name&#39;]));不转义会导致搜索名字</p><p>的时候出错</p><p>38、php使用vendor:vendor(&quot;phpexcel.PHPExcel&quot;);</p><p>39、快递100查询接口：<a href=\"https://m.kuaidi100.com/query?type=huitong&postid=50470823607285&id=1&valicode=&temp=0.49738534969422676\"><span style=\"color: rgb(0, 56, 132);\">https://m.kuaidi100.com/query?type=huitong&amp;postid=50470823607285&amp;id=1&amp;valicode=&amp;temp=0.49738534969422676</span></a></p><p><span style=\"color: rgb(57, 57, 57);\">40、</span><span style=\"color: rgb(223, 64, 42);\">ceil(n)</span> 取大于等于数值n的最小整数--向上取整</p><p><span style=\"color: rgb(223, 64, 42);\">floor(n)</span>取小于等于数值n的最大整数--向下取整</p><p>41、<span style=\"color: rgb(223, 64, 42); font-weight: bold;\">开发遇到的一些坑：</span></p><p>1).php中的if()括号里面不能使用isset()，否则报错；</p><p>2).使用mysql语句的时候，是字符串字段的一定要加单引号或者双引号，否则无法执行sq语	</p><p>句。</p><p>3).能一条sql语句查询的事，不要使用多条sql语句；还有就是sql的事务的开启先后问题。</p><p>42、php特殊字符转义：转义 &nbsp; <span style=\"color: rgb(223, 64, 42);\">htmlspecialchars</span>（） &nbsp; 	解转义 &nbsp;<span style=\"color: rgb(223, 64, 42);\">html_entity_decode（）</span></p><p>例子：‘&amp;’ &nbsp;转义为 ‘&amp;amp;’</p><p>43、$reg=&#39;/\\d+/&#39;;//匹配数字的正则表达式</p><p>44、php中时间戳与时间日期的转换</p><p>时间戳转日期：date(); &nbsp;date(&#39;Y-m-d H:i:s&#39;, 1156219870);</p><p>日期转时间戳：strtotime(); &nbsp;strtotime(&#39;2010-03-24 08:15:42&#39;)；</p><p>45、返回一个日期的 UNIX 时间戳。然后使用它来查找该日期的天：</p><p>mktime(<span style=\"font-style: italic;\">hour</span>,<span style=\"font-style: italic;\">minute</span>,<span style=\"font-style: italic;\">second</span>,<span style=\"font-style: italic;\">month</span>,<span style=\"font-style: italic;\">day</span>,<span style=\"font-style: italic;\">year</span>,<span style=\"font-style: italic;\">is_dst</span>);</p><p><img alt=\"\" data-media-type=\"image\" src=\"D:/xm/%E6%96%87%E4%BB%B6/youdao/jieson414@163.com/80417b2cd29e4cd9a1423c552d853730/clipboard.png\" style=\"width: 369px;\" data-attr-org-src-id=\"034773EFCE244C0F873077665C99A774\"/></p><p>46、<a href=\"https://www.oschina.net/code/snippet_105076_3962\"><span style=\"font-size: 18px; background-color: rgb(255, 255, 255); font-weight: bold;\">PHP定时执行任务的实现</span></a></p><p><span style=\"color: rgb(57, 57, 57);\">建议不要这样写，一般可以借助linux的crontabs来创建定时任务</span></p><p><img alt=\"\" data-media-type=\"image\" src=\"D:/xm/%E6%96%87%E4%BB%B6/youdao/jieson414@163.com/44daa8366e3040079a912ceb636fa37f/clipboard.png\" style=\"width: 579px;\" data-attr-org-src-id=\"2F9AAF90A1594960BD1F4FD40A1F6A54\"/></p><p>47、解决php 上传中文文件名乱码的问题：</p><p>$name=iconv(&quot;UTF-8&quot;,&quot;gb2312&quot;, $name);//把utf-8 转义成gb2312 ,因为apache文件的格式	</p><p>是gb2312</p><p>move_uploaded_file($tmpname, $this-&gt;final_file_path);</p><p>$name=iconv(&quot;gb2312&quot;,&quot;UTF-8&quot;, $name);</p><p>48、<span style=\"color: rgb(223, 64, 42);\">array_column</span>，获取二维数组的的某个键的值，例</p><p>$arr=[array(&#39;id&#39;=&gt;1),array(&#39;id&#39;=&gt;2)]</p><p>$res=array_column（$arr,&#39;id&#39;）</p><p>dump($res)-&gt;$res={</p><p>0=&gt;1,</p><p>1=&gt;2</p><p>}</p><p>49、特殊字符转义：</p><p>htmlspecialchars()//&amp;=&gt;&amp;amp;</p><p>htmlspecialchars_decode()=》解转义</p><p>50、获取ip地址：$_SERVER[&quot;REMOTE_ADDR&quot;]</p><p>51、一般都是伪静态完成的。</p><p>apache开启伪静态模块</p><p>配置置虚拟主机 Allowoverride all 这个是关键</p><p>去网站目录下编写.htaccess配置文件</p><p>具体.ht代码：</p><p>&lt;ifModule mod_rewrite.c&gt;</p><p>Options +FollowSymlinks （允许访问）</p><p>RewriteEngine On (开启伪静态引擎)</p><p>RewriteRule /(\\w+)/ $1.php (第一个正则表示用户输入的URL，第二个表示将用户输入的URL末尾加上.php解析 比如用户输入qwe 实际解析的是qwe.php)</p><p>&lt;/ifModule&gt;</p><p>52、<span style=\"color: rgb(223, 64, 42);\">php程序，对于操作数据库的，遇到增删改的语句，最好把所有需要操作的语句写到一个数	</span></p><p><span style=\"color: rgb(223, 64, 42);\">组，然后foreach这个数组来执行语句，最后使用事务来提交。</span></p><p><span style=\"color: rgb(223, 64, 42);\">53、</span><span style=\"font-size: 32px; font-weight: bold;\">PHP $_SERVER[&#39;HTTP_REFERER&#39;] 	</span></p><p><span style=\"font-size: 32px; font-weight: bold;\">获取前一页面的 URL 地址</span></p><p>54、substr_replace(13760240202, &#39;***&#39;, 3, 4) &nbsp;//隐藏手机号码中间四位</p><p>55、获取13位时间戳：<span style=\"font-family: &quot;Courier New&quot;; color: rgb(220, 220, 170); background-color: rgb(30, 30, 30);\">number_format</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(212, 212, 212); background-color: rgb(30, 30, 30);\">(</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(220, 220, 170); background-color: rgb(30, 30, 30);\">microtime</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(212, 212, 212); background-color: rgb(30, 30, 30);\">(</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(86, 156, 214); background-color: rgb(30, 30, 30);\">true</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(212, 212, 212); background-color: rgb(30, 30, 30);\">),</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(181, 206, 168); background-color: rgb(30, 30, 30);\">3</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(212, 212, 212); background-color: rgb(30, 30, 30);\">,</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(206, 145, 120); background-color: rgb(30, 30, 30);\">&#39;&#39;</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(212, 212, 212); background-color: rgb(30, 30, 30);\">,</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(206, 145, 120); background-color: rgb(30, 30, 30);\">&#39;&#39;</span><span style=\"font-family: &quot;Courier New&quot;; color: rgb(212, 212, 212); background-color: rgb(30, 30, 30);\">)</span></p><p>time() 获取的是10位时间戳</p><p>56、sprintf（‘%s’, &nbsp;$num） ,替换 % 号的参数</p><p>57、foreach的时候，要改变原来的值，可以使用 &amp; 值引用，这样就可以不需要使用老方法	</p><p>$arr[key][&#39;name&#39;]来改变值，例子：</p><p>foreach ($arr as &amp;$value ) {</p><p>$value[name] = $newValue;</p><p>}</p><p>58、</p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">$str = &#39;php学习博客&#39;;</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;; font-weight: bold;\">if</span><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">(preg_match(&#39;/[\\x7f-\\xff]/&#39;, $str)){</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">&nbsp;echo &#39;字符串中有中文&lt;br/&gt;&#39;;</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">}</span><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;; font-weight: bold;\">else</span><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">{</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">&nbsp;echo &#39;字符串中没有中文&lt;br/&gt;&#39;;</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">}</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">&nbsp;</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;; font-weight: bold;\">if</span><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">(preg_match(&#39;/^[\\x7f-\\xff]+$/&#39;, $str)){</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">&nbsp;echo &#39;字符串全是中文&#39;;</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">}</span><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;; font-weight: bold;\">else</span><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">{</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">&nbsp;echo &#39;字符串不全是中文&#39;;</span></p><p><span style=\"font-size: 13px; font-family: &quot;Courier New&quot;;\">}</span></p><p>59验证码手机号：<span style=\"font-size: 13px; font-family: Verdana; background-color: rgb(254, 254, 242);\">preg_match(&quot;/^1[34578]\\d{9}$/&quot;</span></p><p>60、 &nbsp; <span style=\"font-size: 13px;\">is_bool();//判断是否为布尔型</span></p><p><span style=\"font-size: 13px;\">&nbsp;&nbsp; is_float(); //判断是否为浮点型</span></p><p><span style=\"font-size: 13px;\">&nbsp;&nbsp; is_int(); //判断是否为整型</span></p><p><span style=\"font-size: 13px;\">&nbsp;&nbsp; is_numeric(); //判断是否为数值型</span></p><p><span style=\"font-size: 13px;\">&nbsp;&nbsp; is_string(); //判断是否为字符串</span></p><p><span style=\"font-size: 13px;\">&nbsp;&nbsp; is_array(); //判断是否为数组</span></p><p><span style=\"font-size: 13px;\">&nbsp;&nbsp; is_object(); //判断是否为对象</span></p><p><span style=\"font-size: 13px;\">61、</span></p><p><!--5f39ae17-8c62-4a45-bc43-b32064c9388a:--></p><p><br/></p>', '0', '2019-07-04 10:06:37.895575', '2019-07-04 10:06:37.895575', '3', '2', '2');

